import React from 'react';
import { graphql } from 'react-apollo';
import gql from 'graphql-tag';


class YaejiFinish extends React.Component{
state = {
    userName:"blank"
}
async componentDidMount(){
    const uuid = this.props.match.params.uuid;
    if (uuid){
        const userName = await this.props.finish({variables:{uuid}});
        this.setState({userName:userName.data.finishGame.userName});
    }
}
render(){
        window.history.pushState({}, "lemon", "/");
        if (this.state.userName!=="blank"){
            return (<div style={{height:"100%",backgroundColor:"black"}}><YaejiVG username={this.state.userName}/></div>)
        } else {
            return <h1 style={{color:'white',padding:"50px",textAlign:"center"}}>thanks for playing!<br/>~sincerely<br/>teh</h1>
        }
    }
} 

const finishGameMutation = gql`
  mutation($uuid: String!){
    finishGame(uuid: $uuid){
        userName
    }
  }
`;

export default graphql(finishGameMutation,{name:"finish"})(YaejiFinish);


